import Todo from "../todo/Todo";

function List() {
  const a = [
    { name: "아", id: 5 },
    { name: "d", id: 5 },
    { name: "f", id: 2 },
    { name: "g", id: 5 },
    { name: "j", id: 5 },
  ];

  const B = () => {
    let A = a.filter((todolists) => todolists.id !== 2);
  };

  return (
    <div>
      List
      <Todo />
    </div>
  );
}

export default List;
